// import logo from './logo.sv  g';
import './App.css';
import HomeComponent from './components/home';
import { ThemeProvider } from './store/themeContext';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import ChatRoom from './components/chat/chat';

function App() {
  return (
    <ThemeProvider>

      <Router>
        <Switch>
          <Route path="/chatRoom">
            <ChatRoom />
          </Route>
          <Route path="/">
            <HomeComponent />
          </Route>
        </Switch>
      </Router>
    </ThemeProvider>
  );
}



function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

export default App;
